import { Box, TextField } from "@mui/material";

function UrlInputForm() {
  return (
    <Box
      component="form"
      sx={{
        "& > :not(style)": { m: 1, width: "25ch" },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Input Url" variant="outlined" />
    </Box>
  );
}

export default UrlInputForm;
